  declarations: [
    AppComponent,
    HomeComponent,
    MenuInfoComponent,
    BigCardComponent,
    EspecialidadesComponent,
    SaboresComponent,
    PedidoComponent,
    CardapioComponent,
    DaCasaComponent,
    RodapeComponent,
    MenuSocialComponent,
    MenuLocalComponent,
    Menu

  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
